import React from 'react';
import BackgroundVideo from '../../Assets/video/backgroundVideo.mp4'
import Seta from ''
import './main.scss'

export default()=>{

    return(
        <div>
            <video autoPlay loop muted className="video">
                <source src={BackgroundVideo} type="video/mp4"/>
            </video>

            <div className="seta">
                <img />
            </div>
        </div>
    )
}
